import React from "react";
import ReactDOM from "react-dom";
import { Row, Col, Container } from "react-bootstrap";
import { NavbarComp, ListKategori, Hasil } from "./component/index";

const App = () => {
	return (
		<div className="App">
			<NavbarComp />
			<div className="mt-3">
				<Container fluid>
					<Row>
						<ListKategori />
						<Col>
							<h4>
								<strong>Daftar Produk</strong>
							</h4>
							<hr />
						</Col>
						<Hasil />
					</Row>
				</Container>
			</div>
		</div>
	);
};

export default App;
